let projInfoList = { // Implemented as table instead of array so it's easier to keep track of the IDs
    0: {
        title: "GitHub User Page",
        imgsrc: "https://i.ytimg.com/an_webp/kjZSgPCFl3Q/mqdefault_6s.webp?du=3000&sqp=CLDmqqcG&rs=AOn4CLBafZXS9_-nbK5VSKz4HDg-hTWOgA",
        info: (<p>This should be obvious!</p>),
    },
    1: {
        title: "Pre-Babel Chat",
        imgsrc: "https://i.ytimg.com/an_webp/dnIPBOnl4iQ/mqdefault_6s.webp?du=3000&sqp=CIT8qqcG&rs=AOn4CLBQ3TOr-Bd4-KPT-tFPjW8pc1l0Hg",
    },
    2: {
        title: "Linear Algebra Canvas",
        imgsrc: "https://i.ytimg.com/an_webp/gUrRsx-F_bs/mqdefault_6s.webp?du=3000&sqp=CIj8qqcG&rs=AOn4CLC3CuIVOjSI1tcy9HtK9O_OSCjDGA",
    },
  };
  
export default class ProjectState {
    constructor() {
      this.projId = 0;
      this.stateInfo = projInfoList[0];
      this.projInfoList = projInfoList;
    }
  
    set projNum(id) {
      if(~~projInfoList[id]) {
        console.error("Attempted to display project #" + id + ", which does not exist.");
        return;
      }
  
      this.projId = id;
      
    }

    get state() {
        return this.stateInfo;
    }
  }
